// @downloadURL https://update.greasyfork.org/scripts/438918/EatKano%20Keyboard%20Helper.user.js
// @updateURL https://update.greasyfork.org/scripts/438918/EatKano%20Keyboard%20Helper.meta.js
// ==/UserScript==

(function() {
    //'use strict';
    var jquery = document.createElement('script');
    jquery.src = "https://apps.bdimg.com/libs/jquery/2.1.4/jquery.min.js";
    document.getElementsByTagName('head')[0].appendChild(jquery);
    var goo;
    var SZX="data:image/png;base64,";
    var KANO="data:image/png;base64,";
	window.addEventListener("load",function(){
        //alert("nmsl");
		document.addEventListener("keydown",Restart);
        add_btn_style();
        add_win();
        add_btn();
    });
	function Restart(e){
		if(e.key=='Shift')	replayBtn();
	}
    function setImage(url){
		$("#bk-img-style").remove();
        var nw=document.createElement('style');
        document.head.appendChild(nw);
		nw.id='bk-img-style';
        var s="background-size: auto 100%;\nbackground-image:url('";
        nw.innerHTML=".t1,.t2,.t3,.t4,.t5{"+s+url+"')}";
    }

    function add_btn_style(){
		var nw=document.createElement('style');
		document.head.appendChild(nw);
		var s="width: 200px;\
        padding:8px;\
        background-color: #FF33CC;  \
        border-color: #357ebd;  \
        color: #fff;  \
        -moz-border-radius: 10px;  \
        -webkit-border-radius: 10px;  \
        border-radius: 10px;\
        -khtml-border-radius: 10px; \
        text-align: center;  \
        vertical-align: middle;  \
        border: 1px solid transparent;  \
        font-weight: 900;  \
        font-size:125%";
		nw.innerHTML=".btn0{"+s+"}";
	}
    function add_btn(){
		var nw=document.createElement('input');
		GameLayerBG.appendChild(nw);
		nw.id='btn';
		nw.type='button';
		nw.classList.add("btn0");
		nw.style.cssText="\
			z-index:100;\
			position:absolute;\
			top:0px;\
			left:0px;\
			width: 80px;\
		";
		$('#btn')[0].value="";
		nw.addEventListener("click",function(){
			$('#btn').hide();
			win_show();
		})
	}
    function win_show(){
        mddd=[];key_map=[];
        document.removeEventListener("keydown",Mykeydown);
        $("#wd").show();
    }
    function add_win(){
        $("#GameTimeLayer").after("<div id='wd'><p id='cls' >&nbsp;&nbsp;</p></div>");
		$("#wd").hide();
        $("#wd").css({
            "position": "absolute",
            "top": "200px",
            "left": "0px",
            "width": "100%",
            "text-align": "center",
            "background-color": "#CCFFFF",
            "text-color": "#000000",
            "z-index": "998244353",
            "font-size": "4em",
            "height":"600px",
            "overflow": "hidden",
            "border":"2px solid #a1a1a1",
            "border-radius":"25px",
            "overflow-y":"auto"
        });
        $("#cls").css({
            "float": "right",
            "width":"45px",
            "font-size":"30px"
        });
        $("#cls").click(function(){$("#wd").hide();$("#btn").show();});
        $("#cls").after("<div id='tbl' style='font-size:20px; position:absolute; left:25px;top:20px; text-align:left;'></div>");
        var tbl=$("#tbl")[0];
        tbl.innerHTML+='1. : <input type="number"	id="time"	value=20	style="width:100px"> (:, 23)<br /><br />\n';
        tbl.innerHTML+='2. : <input type="text"	id="bk-img"	value=-1 style="width:100px"> ( base64, -1 )<br /><br />\n';
        tbl.innerHTML+='3. : <input type="text"	id="kb-ipt"	value="zxnm" style="width:100px"> (4or)<br /><br />\n';
		tbl.innerHTML+='4. Shift, , (!)....<br /><br />\n';
		tbl.innerHTML+='<div style="text-align:center"><input type="button" id="sbm" class="btn0" value=" !"></div>';
        $("#sbm").click(function(){sbmt();});
    }
    function sbmt(){
        $("#wd").hide();
		$("#btn").show();
        _gameTimeNum=$("#time")[0].value;
		var val=$("#bk-img")[0].value;
		if(val==-1){
            setImage(KANO);
        }
        else if(val==0){
			setImage(SZX);
        }
        else{
			setImage(val);
		}
		setkb($("#kb-ipt")[0].value);
    }
	var mddd=new Array(),key_map=new Array();
	function kbtap(k){
        console.log(k);
        gameTapEvent(mddd[k]);
    }
	function setkb(KB_str){
		for(var i=0;i<4;i++){
			var c=i+4,s="GameLayer1-"+c;
			var Ele=document.getElementById(s).getBoundingClientRect();
			var tp={type:"mousedown",clientX:Ele.x+10,clientY:Ele.y+10,target:GameLayerBG};
			mddd.push(tp);
			key_map[KB_str[i]]=i;
		}
        console.log(key_map);
        console.log(mddd);
		document.addEventListener("keydown",Mykeydown);
	}
    function Mykeydown(e){
		console.log(e);
		var p=key_map[e.key];
		if(p<4 && p>=0) kbtap(p);
    }
})();